import React, { useContext, useEffect } from "react";
import { Context } from "../App";
import { Routes, Route, BrowserRouter, Navigate } from "react-router-dom";

import Navbar from "../components/Navbar/Navbar";
import CookiesRequest from "../components/CookiesRequest";

import MatchDetails from "./matchDetails/MatchDetails";
import CountryRankingPage from "./countryRanking/CountryRankingPage";
import IndexPage from "./index/IndexPage";
import LogoutPage from "./logout/LogoutPage";
import LoginPage from "./signIn/LoginPage";
import RegisterPage from "./signUp/RegisterPage";
import ProfilePage from "./profile/ProfilePage";
import LeaguePage from "./league/LeaguePage";
import ConfirmEmailPage from "./confirmEmail/ConfirmEmailPage";

import "../index.css";
import DashboardPage from "./admin/dashboard/DashboardPage";
import ForgotPasswordPage from "./forgotPassword/ForgotPasswordPage";

const ProtectedRoute = ({
  anti = false,
  children,
  admin = false,
  confirmed = false,
}) => {
  const { user, updateAuth } = useContext(Context);

  useEffect(() => {
    if (user === null) {
      updateAuth();
    }
  }, [user, updateAuth]);

  if (admin && !user.admin) {
    return <Navigate to="/" replace />;
  } else if (user.auth && anti) {
    return <Navigate to="/" replace />;
  } else if (user.auth === false && anti === false && confirmed === false) {
    return <Navigate to="/" replace />;
  }

  return children;
};

function AppRoutes() {
  const { darkmode, showCookiesRequset } = useContext(Context);

  return (
    <BrowserRouter>
      <Navbar />
      <div className={darkmode === "darkmode" ? "routes" : "routes_lightmode"}>
        <Routes>
          <>
            <Route path="/" element={<IndexPage />} />
            <Route
              path="login"
              element={
                <ProtectedRoute anti={true}>
                  <LoginPage />
                </ProtectedRoute>
              }
            />
            <Route
              path="logout"
              element={
                <ProtectedRoute>
                  <LogoutPage />
                </ProtectedRoute>
              }
            />
            <Route
              path="signup"
              element={
                <ProtectedRoute anti={true}>
                  <RegisterPage />
                </ProtectedRoute>
              }
            />
            <Route
              path="profile"
              element={
                <ProtectedRoute>
                  <ProfilePage />
                </ProtectedRoute>
              }
            />
            <Route path="match_details/:match_id" element={<MatchDetails />} />
            <Route path="country_ranking" element={<CountryRankingPage />} />
            <Route path="/league/:league_id" element={<LeaguePage />} />
            <Route
              path="/confirm_email/:email/:token"
              element={<ConfirmEmailPage />}
            />
            <Route
              path="/forgot_password"
              element={
                <ProtectedRoute anti>
                  <ForgotPasswordPage />
                </ProtectedRoute>
              }
            />
            <Route path="/change_password/:email/:token" element={<div />} />
          </>
          <>
            <Route
              path="/admin/dashboard"
              element={
                <ProtectedRoute admin={true}>
                  <DashboardPage />
                </ProtectedRoute>
              }
            />
            <Route
              path="/admin/followedMatches"
              element={
                <ProtectedRoute admin={true}>
                  <DashboardPage />
                </ProtectedRoute>
              }
            />
          </>
          <Route path="*" element={<h1>Page not found</h1>} />
        </Routes>
      </div>
      {showCookiesRequset && <CookiesRequest />}
    </BrowserRouter>
  );
}

export default AppRoutes;
